import React, { Component } from "react";
import Audio from "../Audio/Audio";
import "./RightSidebar.scss";

export default class RightSidebar extends Component {
  state = {
    openRightSidebar: false,
    topCharts: [
      {
        id: 1,
        songName: "I Love You Mummy",
        artist: "Arebica Luna",
        path: one,
      },
      {
        id: 2,
        songName: "Shack your butty",
        artist: "Gerrina Linda",
        path: two,
      },
      {
        id: 3,
        songName: "Do it your way(Female)",
        artist: "Zunira Willy & Nutty Nina",
        path: three,
      },
      {
        id: 4,
        songName: "Say yes",
        artist: "Johnny Marro",
        path: four,
      },
      {
        id: 5,
        songName: "Where is your letter",
        artist: "Jina Moore & Lenisa Gory",
        path: five,
      },
      {
        id: 6,
        songName: "Hey not me",
        artist: "Rasomi Pelina",
        path: six,
      },
    ],
  };
  handleOpenSidebar = () => {
    const { openRightSidebar } = this.state;
    this.setState({
      openRightSidebar: !openRightSidebar,
    });
  };
  render() {
    const { openRightSidebar } = this.state;
    return (
      <div
        className={
          openRightSidebar ? "right-sidebar minimize-sidebar" : "right-sidebar"
        }
      >
        <div className="right-sidebar-header">Listen Special</div>
        <div
          className="right-sidebar-body ps ps--active-y"
          data-scrollable="true"
        >
          <ul className="list-group list-group-flush">
            <li className="custom-list--item list-group-item">
              <div className="text-dark custom-card--inline amplitude-song-container amplitude-play-pause amplitude-paused">
                <div className="custom-card--inline-img"></div>
                <div className="custom-card--inline-desc">
                  <p className="text-truncate mb-0">I love Mummy </p>
                  <p className="text-truncate text-muted font-sm"></p>
                </div>
              </div>
            </li>
          </ul>
        </div>
        <Audio handleOpenSidebar={this.handleOpenSidebar} />
      </div>
    );
  }
}
